// Imports
import React, { Component } from "react";
import Bar from "../Bar/Bar";
import GridSize from "../Grid/GridSize/GridSize";

class App extends Component {
  render() {
    return (
      <div>
        <Bar />
        <div id="main_container">

          <table>
            <tbody id="grid"></tbody>
          </table>
        </div>
      </div>
    );
  }
}
export default App;
